import React from "react";
import { Container } from "reactstrap";

const Footer = () => {
  return (
    <Container
      fluid
      tag="footer"
      className="text-center bg-info text-white text-uppercase fixed-top p-3"
    >
      Piratedeepak Github Search App
    </Container>
  );
};

export default Footer;
